import React, { Component } from "react";
import Prism from "prismjs";
import { Grid, Paper, withStyles, List } from "@material-ui/core";

import "../../ReactJs/styles.css";
import Sidebar from "../sidebar";
import PrismCode from "../../ReactJs/prismCode";

const titles = { backgroundColor: "#F0F8FF", padding: "1px", fontSize: "16px" };

const styles = (theme) => ({
  paper: {
    margin: theme.spacing(1),
    padding: theme.spacing(1),
  },
  smMargin: {
    margin: theme.spacing(1),
  },
  actionDiv: {
    textAlign: "center",
  },
});


const insersonSort = `
function fun() {
  const arr = [3, 5, 1, 9, 6, 2, 1, -1];
  const hashSet = new Set(arr);
  const result = [...hashSet].sort((a, b) => a - b);
  console.log(result);
}

fun();
`.trim();

const mergSort = `
function removeDup() {
  const arr = [1, 2, 3, 4, 3,2,1];
  const hash = {};
  const result = [];

  for (let i = 0; i < arr.length; i++) {
    if (hash[arr[i]]) {
      hash[arr[i]]++;
    } else {
      hash[arr[i]] = 1;
    }
  }

  for (let i = 0; i < arr.length; i++) {
    if (hash[arr[i]] === 1) {
      result.push(arr[i]);
    }
  }

  console.log(result);
}

removeDup();
`.trim();

const quicksort = `
function uniqueWords(arr) {
  if (arr.length === 0) {
    return [];
  }

  const currentWord = arr[0];
  const remainingWords = arr.slice(1);
  const uniqueRemainingWords = uniqueWords(remainingWords);

  if (!uniqueRemainingWords.includes(currentWord)) {
    return [currentWord, ...uniqueRemainingWords];
  }

  return uniqueRemainingWords;
}

function removeDup() {
  const arr = [1, 2, 3, 4, 3, 2, 1, 0];
  const uniqueArr = uniqueWords(arr);

  console.log(uniqueArr);
}

removeDup();
`.trim();

const selectionSort = `
function sorts(arr) {
  if (arr.length <= 1) return arr;

  const pivot = arr[Math.floor(Math.random() * arr.length)];
  const left = [], equal = [], right = [];

  for (let num of arr) {
    if (num < pivot) {
      left.push(num);
    } else if (num === pivot) {
      equal.push(num);
    } else {
      right.push(num);
    }
  }

  return [...sorts(left), ...equal, ...sorts(right)];
}

const arr = [0, 9, 8, 7, 6];
console.log(sorts(arr));
`.trim();

const Permutations = `
Time complexity: O(n^2)
Space complexity: O(n)


function combiSum(arr, num) {
  const result = [];
  const sum = new Set();

  for (let i = 0; i < arr.length; i++) {
    const ele = num - arr[i];
    if (sum.has(ele)) {
      result.push([arr[i], ele]);
    }
    sum.add(arr[i]);
  }

  console.log(result);
}

combiSum([2, 1, 4, 3, 5], 7);
`.trim();

const amount = `
function getCount() {
  var str = 'appleo';
  var hash = {};

  for (var i = 0; i < str.length; i++) {
    var char = str[i].toLowerCase();
    if ('aeiou'.includes(char)) {
      if (hash[char]) {
        hash[char]++;
      } else {
        hash[char] = 1;
      }
    }
  }

  var obj = new Map(Object.entries(hash));
  console.log(obj);
}

getCount();
`.trim();

const armstrong = `
Time complexity: O(n)
Space complexity: O(n)

function fun(num) {
  const newnum = num.toString().split('');
  const hash = newnum.reduce((sum, digit) => {
    const cube = Math.pow(parseInt(digit), newnum.length);
    return sum + cube;
  }, 0);

  if (hash === num) {
    return { type: 'Armstrong', hash: hash };
  } else {
    return { type: 'Not Armstrong', hash: hash };
  }
}

const hash = fun(153);
console.log(hash); `.trim(); 

const satisfy = `
